import React, { Component } from 'react';

class UserList extends Component {
    state = {
        users: [],
    };

    getUsers = () => {
        axios
            .get('http://127.0.0.1:8000/accounts/')
            .then(({ data }) => {
                console.log(data);
                this.setState({
                    users: data,
                });
            })
            .catch((e) => {
                console.error(e);
            });
    };

    componentDidMount() {
